/**
 * Web Font Loader Config
 * This should precede the Web Font Loader as I opted not to load Web Font Loader asynchronously
 * Mutex "kyryllFontsLoaded" is declared here and is bound to kyryll.init in kyryll.js
 */
var kyryllFontsLoaded = $.Callbacks("memory once");
var WebFontConfig = {
  custom: {
    families: ["Baskerville-Regular", "Baskerville-Italic", "Baskerville-Bold", "Chennai-Regular", "Chennai-Light", "Chennai-Bold", "Quicksand-Bold", "Segoe-Print"],
    urls: ["css/fonts.css"]
  },
  loading: function () { console.log("Loading fonts.."); },
  active: function () { kyryllFontsLoaded.fire(); },
  fontinactive: function (font, fvd) { console.log("Could'nt load " + font + " font"); },
  inactive: function () { console.log("All fonts failed loading..\n\rTrying to load site anyway.."); kyryllFontsLoaded.fire(); }
};

